import React, {useEffect, useState} from 'react'
import axios from "axios";
import App from "../../../App";

/**
 * The ApplicationTable is meant to retrieve and store data
 * @returns {JSX.Element}
 */
const ApplicationTable = () => {

    /**
     * Represents and stores the applications as an array of JSON objects.
     */
    const [applications, setApplications] = useState(0)

    useEffect(() => {
        (async () => {
            const response = await axios.get('http://localhost:3000/api/applications')
                .catch(error => {console.error(error)})
            const data = response.data
            const jsonData = data.json()
            setApplications(jsonData)
        })();
    }, [])

    return (
        <div className='app__table__container'>
            <table>
                <thead>
                <tr>
                    <th colSpan="1">Business name</th>
                    <th>Description</th>
                    <th>Role type</th>
                    <th>Status</th>
                    <th>Created date</th>
                    <th>Options</th>
                </tr>
                </thead>
                <tbody>
                <tr>

                </tr>
                </tbody>
            </table>
        </div>
    )
}

/**
 * The ApplicationTable is meant to retrieve and store data
 * @returns {JSX.Element}
 */
export default ApplicationTable
